.dataImportPage {
  height: calc(100vh - 135px);
  background: #fff;
  margin: 0 16px 16px 16px;
  padding: 16px;
  border-radius: 8px;
  overflow: hidden;

  ::v-deep .el-step__title.is-finish {
    //color: #C0C4CC;
    color: white;
  }
  ::v-deep .el-step__title.is-process {
    //color: #79AC43;
    color: white;
  }

  ::v-deep .el-step__title.is-wait {
    color: white;
  }

  ::v-deep .el-upload-list__item.is-ready {
    width: 400px;
  }


}

.processCss{
  ::v-deep .el-steps.el-steps--simple {
    background: linear-gradient(to right,#79AC43 0%,#79AC43 40%,#C0C4CC 44%,#C0C4CC 100%);
  }
}
.finishCss{
  ::v-deep .el-steps.el-steps--simple {
    background: linear-gradient(to right,#C0C4CC 0%,#C0C4CC 56%,#79AC43 60%,#79AC43 100%);
  }
}
